import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the main content to be loaded (hero banner or categories grid)
    await page.waitForSelector('.categories-grid', { timeout: 5000 });

    // Try to find the Electronics category card in the categories grid
    // Use text and class selector
    const electronicsCard = await page.locator('.category-card', { hasText: 'Electronics' }).first();
    await electronicsCard.waitFor({ state: 'visible', timeout: 3000 });

    // Take screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_click_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_click_electronics.png'));

    // Click the Electronics category card
    await electronicsCard.click();

    // Wait for the category results to load (h2 with "Electronics" and .category-results)
    await page.waitForSelector('.category-results', { timeout: 5000 });
    const categoryHeader = await page.locator('.category-results h2');
    await categoryHeader.waitFor({ state: 'visible', timeout: 3000 });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_category.png'));

    // Extract verification data: header text and product titles
    const headerText = await categoryHeader.textContent();
    const productTitles = await page.$$eval('.products-grid .product-title', els => els.map(e => e.textContent.trim()));

    return {
      success: true,
      action: "Navigated to Electronics category via category card and verified product listing.",
      extractedData: {
        categoryHeader: headerText,
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
